package day23_arrays_and_loops;

public class PrintNumbersWithLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// HELLO NEW NEIGHBOR
		
		for(int i=1; i<=2; i++ ) {
			
			for (int j=1; j<=10; j++) {
				System.out.print(j+",");
				
			}
			System.out.println();
		}
	}

}
